function SmFinalTrial
%In rotating reference frame (SImulink model)
%Given machine parameters
Rs = 0.01524;
Ll = 0.01524;
Lmd = 2.81;
Lmq = 1.64;
Rfd = 0.004319;
Llfd = 0.531;
Rkd = 0.2343;
Llkd = 2.655;
Rkq1 = 0.03365;
Llkq1 = 0.2408;
H = 0.3222;
F = 0.01322;

%Calculated machine parameters
Ld = Ll + Lmd;
Lq = Ll + Lmq;
Lfd = Llfd + Lmd;
Lkd = Llkd + Lmd;
Lkq1 = Llkq1 + Lmq;
Lkq2 = Llkq1 + Lmq;
Rkq2 = 0.03365;


%Network reference frame stator terminal voltages
% V_q = 0;
% V_d = 1;
PL = 1; dPdt = 0.00000;
%Pm = 0.8;%Input mechanical power
V_fd = 0.001;%Input field excitation
wb = 377;omega_b = wb; omega_s = 1;
omega0 = 1;
dV_ddt = 0.0001; 
omega_0 = 1;
t0 = [0;0.02];
x0 = [   -0.0754   -0.4732    2.1842    0.8099    0.7163   -1.0056    0.4340    1.0000   -1.0922    0.8000    0.0100];
%x0 = [    1.6865   -0.3864   -0.5051    0.4081    1.0724    0.9680    0.2701    1.0000    0.6298    0.8000];
%x0(1:2) = [1.2 0.12];
%x0 = ones(10,1);
x0 = x0(1:10);
%x0 = randn(10,1)
x0(8) = 1; %x0(9:10) = [0.1 PL];
x0(9) = 0.8*PL;%x0(11) = 0.01
chomichu!
tic
[t,x] = ode45(@SimulateExactSM,t0,x0);
toc
function dx = SimulateExactSM(t,x)
%Rotor reference frame quantities
i_d = x(1);
i_q = x(2);
i_fd = x(3);
i_kd = x(4);
i_kq1 = x(5);
i_kq2 = x(6);
delta = x(7);
omega = x(8);
V_q = x(10);
PL = x(9);
%Transformation matrix (from network to machine)
Tn2m = [sin(delta) cos(delta);
    -cos(delta)  sin(delta)];
Tm2n = [sin(delta) -cos(delta);
    cos(delta)  sin(delta)];

	t
Inet = Tm2n*[i_d;i_q]; I_d = Inet(1); I_q = Inet(2);
V_d = (PL - I_q*V_q)/I_d;
Vm = 1.2;%%PL/(e_fd*sin(delta));
dV_ddt = -Vm*sin(atan(V_q/V_d))*omega0; 
%V_q = sqrt(Vm^2 - V_d^2);
V_fd = -10*(Vm - sqrt(V_d^2 + V_q^2)); 
%stator terminal voltages in rotating reference
V_mach = Tn2m*[V_d;V_q]; v_d = V_mach(1); v_q = V_mach(2);
Pm = PL + 2*H*(omega-omega0);
%Current vector in machine reference
I = [i_d;i_q;i_fd; i_kd;i_kq1; i_kq2];
    %i_d i_q i_fd i_kd i_kq1 i_kq2
L = [Ld   0   Lmd  Lmd   0     0;
      0   Lq   0    0    Lmq   Lmq;
      Lmd 0    Lfd  Lmd   0     0
      Lmd 0    Lmd  Lkd   0     0
      0   Lmq  0    0     Lkq1  Lmq
      0   Lmq  0    0     Lmq     Lkq2];
